import 'InputsRegistration.scss'

export const InputsRegistration = () => {
    return (
        <div className="inputContainer">
            <input type="Фамилия" className="inputStyle" placeholder="Введите фамилию"/>
        </div>
    )
}

export default InputsRegistration;
